import React from 'react';
import { Header, List } from 'semantic-ui-react';

class Portfolio extends React.Component {
  render(){
    return (
      <div className='portfolio'>
        <List divided={true} horizontal>
          <List.Item as='h4' disabled={true}>Portfolio</List.Item>
          <List.Item as='h4' onClick={() => this.props.history.changeURL('/transactions')}>Transactions</List.Item>
        </List>
      </div>
    )
  };
};

export default Portfolio;
